import { ArrowLeftOutlined, ArrowRightOutlined } from '@material-ui/icons'
import React from 'react'
import styled from 'styled-components'

const Container= styled.div`
width:100%;
height: 100vh;
display : flex;
background-color:coral;
position:relative;
`;

const Arrow=styled.div`
width: 50px;
height: 50px;
background-color: #fff7f7;
border-radius: 50%;
display:flex;
align-text:center;
justify-text:center;
position:absolute;  {/* The parents postion must be relative */}
`
const Slider = () => {
  return (
   <Container>
    <Arrow>
        <ArrowLeftOutlined/>
    </Arrow>
    <Arrow>
        <ArrowRightOutlined/>
    </Arrow>
   </Container>
  )
}

export default Slider
